import React from 'react';
import PizzaLeft from '../assests/pizzaLeft.jpg'
function Contact() {
  return( 
  <div className='contact'>
      <div className='leftSide' style={{backgroundImage: `url(${PizzaLeft})` }}></div>
      <div className='rightSide'></div>
  </div>
  );
}

export default Contact;
